import React from 'react';

const Experience = () => {
    return (
        <div className="experience">
            <h3>Expérience</h3>
            <div className="exp1">
                <h4>Etudiant Epitech en 5ème année</h4>
                <h5>2017-2022</h5>
                <p></p>
            </div>
        </div>
    );
};

export default Experience;
